'toolkit/chrome/global/aboutRights.dtd:rights.webservices-term4' => 'IiNkonzo zinikezwa &#34;zinjengoko zinjalo.&#34;  i-&amp;vendorShortName;, abaniki-galelo, abaniki-layisensi, kunye nabasasazi bazo, bayazikhupha kwibango lazo zonke iziqinisekiso, nokuba zivakalisa ngokuphandle okanye ngokusebenzayo, ukuquka ngaphandle kwezithintelo, iziqinisekiso zokuba iiNkonzo ziyarhwebeka kwaye zizilungele iinjongo  zakho ezithile. Uya kubuthathela kuwe bonke ubungozi obunokuvela ekukhetheni kwakho iinkonzo ezifanele iinjongo zakho nangokumayela nomgangatho kwanokusebenza kweenkonzo. Ezinye iindawo zolawulo azikuvumeli ukukhutshelwa ngaphandle okanye ukuncitshiswa kweewaranti ezingathiwanga pahaha, ngoko ke oku kungabi nabutyala abusebenzi kuwe.',
